import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
  const [formData, setFormData] = useState({
    fullName: "",
    email: "",
    degree: "",
    university: "",
    graduationYear: "",
    skills: "",
    interests: "",
    experience: "",
    certifications: "",
    careerGoals: "",
  });

  const [careerSuggestions, setCareerSuggestions] = useState([]);
  const [showSuggestions, setShowSuggestions] = useState(false);
  const navigate = useNavigate();

  // ✅ Check token on load
  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      alert("❌ Unauthorized. Please login first.");
      navigate("/login");
    } else {
      fetchDashboard();
    }
  }, [navigate]);

  const getToken = () => localStorage.getItem("token");

  const fetchDashboard = async () => {
    try {
      const res = await fetch("http://localhost:5000/api/dashboard", {
        headers: {
          Authorization: `Bearer ${getToken()}`,
        },
      });

      if (res.status === 401) {
        alert("❌ Session expired. Please login again.");
        localStorage.removeItem("token");
        navigate("/login");
      }

      const data = await res.json();
      console.log("Dashboard user info:", data);
    } catch (err) {
      console.error("Dashboard fetch error:", err);
    }
  };

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await fetch("http://localhost:5000/api/resume/save", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${getToken()}`,
        },
        body: JSON.stringify(formData),
      });

      if (!res.ok) throw new Error("Submission failed");

      alert("🎯 Career suggestions generated.");
      setCareerSuggestions([
        "Software Developer",
        "AI/ML Engineer",
        "UI/UX Designer",
        "Cybersecurity Analyst",
      ]);
      setShowSuggestions(true);
    } catch (err) {
      console.error(err);
      alert("❌ Error submitting form.");
    }
  };

  const generateResume = async () => {
    try {
      const response = await fetch("http://localhost:5000/api/resume/generate", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${getToken()}`,
        },
        body: JSON.stringify(formData),
      });

      if (!response.ok) throw new Error("Resume generation failed");

      const blob = await response.blob();
      const url = window.URL.createObjectURL(blob);
      const link = document.createElement("a");
      link.href = url;
      link.setAttribute("download", "Resume.txt");
      document.body.appendChild(link);
      link.click();
      link.remove();
      window.URL.revokeObjectURL(url);

      alert("✅ Resume downloaded.");
    } catch (err) {
      alert("❌ Resume download failed.");
      console.error(err);
    }
  };

  const startMockInterview = async () => {
    try {
      const res = await fetch("http://localhost:5000/api/interview/mock", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${getToken()}`,
        },
        body: JSON.stringify({ role: formData.careerGoals }),
      });

      const data = await res.json();
      alert("🎙️ Mock Interview:\n\n" + data.interview);
    } catch (err) {
      alert("❌ Could not fetch mock interview.");
      console.error(err);
    }
  };

  const analyzeSkillGap = async () => {
    try {
      const res = await fetch("http://localhost:5000/api/skills/analyze", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${getToken()}`,
        },
        body: JSON.stringify({
          careerGoal: formData.careerGoals,
          currentSkills: formData.skills,
        }),
      });

      const data = await res.json();
      alert("📊 Skill Gap:\n\n" + data.suggestions);
    } catch (err) {
      alert("❌ Skill analysis failed.");
      console.error(err);
    }
  };

  const logout = () => {
    localStorage.removeItem("token");
    navigate("/login");
  };

  return (
    <div style={styles.page}>
      <div style={styles.container}>
        <h2>Smart Career Platform</h2>
        <button onClick={logout} style={{ float: "right", marginBottom: "10px" }}>🚪 Logout</button>

        <form onSubmit={handleSubmit} style={styles.form}>
          <input type="text" name="fullName" placeholder="Full Name" value={formData.fullName} onChange={handleChange} style={styles.input} required />
          <input type="email" name="email" placeholder="Email" value={formData.email} onChange={handleChange} style={styles.input} required />
          <input type="text" name="degree" placeholder="Degree" value={formData.degree} onChange={handleChange} style={styles.input} required />
          <input type="text" name="university" placeholder="University" value={formData.university} onChange={handleChange} style={styles.input} required />
          <input type="number" name="graduationYear" placeholder="Graduation Year" value={formData.graduationYear} onChange={handleChange} style={styles.input} required />
          <textarea name="skills" placeholder="Skills" value={formData.skills} onChange={handleChange} style={styles.textarea} required />
          <textarea name="interests" placeholder="Interests" value={formData.interests} onChange={handleChange} style={styles.textarea} required />
          <textarea name="experience" placeholder="Experience / Projects" value={formData.experience} onChange={handleChange} style={styles.textarea} required />
          <textarea name="certifications" placeholder="Certifications" value={formData.certifications} onChange={handleChange} style={styles.textarea} />
          <textarea name="careerGoals" placeholder="Career Goals" value={formData.careerGoals} onChange={handleChange} style={styles.textarea} />

          <button type="submit" style={styles.button}>Get Career Suggestions</button>
        </form>

        {showSuggestions && (
          <>
            <div style={styles.suggestions}>
              <h3>Career Suggestions:</h3>
              <ul>
                {careerSuggestions.map((career, i) => (
                  <li key={i}>{career}</li>
                ))}
              </ul>
            </div>

            <div style={styles.greenFeatureButtons}>
              <button onClick={generateResume} style={styles.greenBtn}>Generate Resume</button>
              <button onClick={startMockInterview} style={styles.greenBtn}>Mock Interview</button>
              <button onClick={analyzeSkillGap} style={styles.greenBtn}>Skill Gap Analysis</button>
            </div>
          </>
        )}
      </div>
    </div>
  );
};

const styles = {
  page: {
    background: "#eef6ff",
    minHeight: "100vh",
    padding: "30px 20px",
  },
  container: {
    backgroundColor: "#fff",
    padding: "25px",
    borderRadius: "10px",
    maxWidth: "800px",
    margin: "auto",
    boxShadow: "0 4px 10px rgba(0,0,0,0.1)",
  },
  form: {
    display: "flex",
    flexDirection: "column",
    gap: "12px",
  },
  input: {
    padding: "12px",
    borderRadius: "6px",
    fontSize: "16px",
    border: "1px solid #ccc",
  },
  textarea: {
    minHeight: "60px",
    padding: "12px",
    fontSize: "16px",
    borderRadius: "6px",
    border: "1px solid #ccc",
  },
  button: {
    backgroundColor: "#2563eb",
    color: "#fff",
    fontSize: "16px",
    padding: "12px",
    borderRadius: "6px",
    marginTop: "15px",
    cursor: "pointer",
    border: "none",
  },
  suggestions: {
    background: "#f1f5f9",
    padding: "20px",
    borderRadius: "8px",
    marginTop: "20px",
  },
  greenFeatureButtons: {
    display: "flex",
    gap: "15px",
    flexWrap: "wrap",
    justifyContent: "center",
    marginTop: "20px",
  },
  greenBtn: {
    padding: "10px 16px",
    backgroundColor: "#22c55e",
    color: "#fff",
    border: "none",
    borderRadius: "6px",
    cursor: "pointer",
    fontWeight: "600",
  },
};

export default Dashboard;
